export default function Square({ text, x, y, onClick }) {
  return (
    <div className="square" style={styles.square} onClick={() => onClick(x, y)}>
      {text}
    </div>
  );
}

const styles = {
  square: {
    width: "100px",
    height: "100px",
    backgroundColor: "lightgray",
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
  },
};
